import React from "react"
import { useParams } from "react-router"
import NotFoundPage from "../notFound/notFoundPage"

const ProductDetailPage = props => {
    const params = useParams()

    if (!params.id) {
        return <NotFoundPage />
    }

    return (
        <div></div>
    )
}

export default ProductDetailPage
